const ArchiveList = ({ archiveMode, archiveList }) => {

  return (
    <div id="archive__list">
      {
        archiveMode === 'place' && (
          <ul>
          {
          archiveList.place.map((place) => (
            <div className="archive__list__item"></div>
          ))
          }
        </ul>
        )
      }
    </div>
  )
}

export default ArchiveList
